import React from "react"
import Conditional from "./Conditional";

class App extends React.Component{

    constructor(){
        super();
        this.initials1 = {
            isLoading:true
        }
    }

    componentDidMount(){
        setTimeout(()=>{
            this.setinitials1({
                isLoading:false
            })
        },1500)
    }
    render(){
        return(
            this.initials1.isLoading?<h1>Loading...!</h1> :<Conditional />   
        )
    }
}


export default App
